export class Produtos {
    id: number = 0;
    nome_produto: string = "";
    descricao_curta: string = "";
    
    preco: number = 0;
    quantidade_estoque: number = 0;
    categoria: string = "";
    link_foto: string ="";
  descricao_curta: any;
  descricao_longa: any;
    
    constructor(obj?:Produtos){
        if(obj!=undefined){
            this.id = obj.id;
            this.nome_produto = obj.nome_produto;
            this.descricao = obj.descricao;
            this.preco = obj.preco;
            this.quantidade_estoque = obj.quantidade_estoque;
            this.categoria = obj.categoria;
            this.link_foto = obj.link_foto;
        }
    }
}
